import React from 'react';
import { useNavigate } from 'react-router-dom';
import classes from './Catalog.module.css';
import {data} from '../../data/data';
// import CatalogCardElem from 'Pages/CatalogCardElem/CatalogCardElem';
// import { Context } from 'Context/Context';

export default function Catalog() {
    const navigate = useNavigate();
    const titles:string[] = [];
    const nameLink:string[] = [];
    data.forEach((elem) => {
        titles.push(elem.title);
        nameLink.push(elem.nameLink);
    });
    
    return (
        <main className={classes.catalog__container}>
            <h3>Каталог</h3>
            <div className={classes.catalog_cards__container}>
                {titles.map((el, id)=> {
                    // return <CatalogCardElem key = {id+1} onClick={() => navigate(`/${nameLink[id]}>`)}/>
                    return <span key = {el} className={classes.catalog__card} onClick={() => navigate(`/${nameLink[id]}>`)}>{el}</span>
                })}
            </div>
        </main>
    );
}
